import React from 'react';
import { AllHead } from './components/header';

export const Portfolio = () => (
	<main>
		<img
			src="./img/portf.jpeg"
			alt="home"
			className="absolute dib overflow-hidden obj-cover top-0 left-0 border-box z-1"
		/>
		<AllHead />
	</main>
);
